import React, { Component } from 'react';
import { Button } from 'react-bootstrap';



class Kayitlogo extends Component {
    render() {
        return (
            <div className='kitapkayit'>
                <a href="/kitapkayit">Kitap Ekle</a>
            </div>
        )
    }
}
export default Kayitlogo;
